INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(187442, 'zhTW', '', '你背負許多罪孽，但沒有一項能比虐待無辜者更令人作嘔的了。', 37474),
(38124, 'zhTW', '擁抱黑暗...永恆的黑暗。', '擁抱黑暗…永恆的黑暗。', 37474),
(180366, 'zhTW', '', '很榮幸能由我負責歡迎你來到昇靈堡！雖然…你跟我以前看過的靈魂都不一樣，但沒關係。', 37474),
(187280, 'zhTW', '在蛛眼家族滅亡後，我們的秘密總算安全了。沒有人可以阻礙我們的使命了。', '', 37474),
(185904, 'zhTW', '忌妒？拜託，我各方面都比他強多了！', '', 37474),
(182733, 'zhTW', '知識印記。驅散無知與恐懼的信標。', '', 37474),
(180367, 'zhTW', '', '你注定要成為琪瑞安！我們的神聖使命就是將凡人的靈魂帶到審斷者面前接受審判。', 37474),
(194383, 'zhTW', '', '這應該會很有意思。', 37474),
(182626, 'zhTW', '', '等你準備好了，就靠近火焰，聽從看守者的指示。', 37474),
(202313, 'zhTW', '', '我要把他們串起來！切碎！砍斷！解剖！再切成一條一條的…', 37474),
(202311, 'zhTW', '嗯，我有個主意…我們可以把這些恣意妄為、眼界狹窄的生物抓起來，用他們的骨骸為我們的晉升之道鋪路。該怎麼做呢…怎麼做呢？', '', 37474),
(202310, 'zhTW', '', '我有更好的主意，主宰！我來切碎他們！', 37474),
(202312, 'zhTW', '', '求求您，主人！我已經好久沒有活宰血肉之軀了！', 37474),
(202315, 'zhTW', '我會協助賓客完成贖罪的過程。等到他們徹底悔改之後，我允許你撕碎他們的肉體，然後再把他們慘叫的靈魂送入淵喉！', '', 37474),
(205464, 'zhTW', '', '我現在知道你那個世界的人為什麼會被視為強大的生物了。你們能擊退燃燒軍團也沒有什麼好奇怪的。我代表亞登曠野，感謝你的這一份力量。', 37474),
(191962, 'zhTW', '<雕像的底座刻著下列文字。>\n\n通過力量的試煉，才能贏得眾人的尊重，我們向脫穎而出的勇士「敬禮」。', '', 37474),
(191966, 'zhTW', '<雕像基座刻著文字。>\n\n或許在黑暗之中，才能找到隱藏的真相。高手能夠透過「潛行」輕鬆穿越敵陣。', '', 37474),
(180775, 'zhTW', '必須警告…樹林長…', '必須警告…樹林長…', 37474),
(193577, 'zhTW', '', '小心拿穩了。', 37474),
(186290, 'zhTW', '這頂王冠兼具優雅與強大，足以守護國度。', '', 37474),
(193598, 'zhTW', '', '啊…該把你丟到哪裡呢？', 37474),
(193582, 'zhTW', '', '想不想試用一下？', 37474),
(203409, 'zhTW', '有把武器…在托迦司的火焰中鑄造成形。一把哀傷之刃誕生了。', '', 37474),
(196707, 'zhTW', '隨時準備開火！', '', 37474),
(199409, 'zhTW', '你想要我的靈魄？怎麼不去找那些古老的木靈？', '', 37474),
(199444, 'zhTW', '來吧，我們速戰速決！', '', 37474),
(198956, 'zhTW', '$c，我沒時間應付這件事，女伯爵正在等我。', '$c，我沒時間應付這件事，女伯爵正在等我。', 37474),
(206412, 'zhTW', '', '$p，你為什麼會來瑪卓薩斯？\n\n需要更多蘑菇製作你的宴會佳肴，還是需要更多瑪卓薩斯的士兵幫你保衛城牆？\n\n<瓦許女爵露出微笑。>\n\n我必須承認，我比原本預期的更加享受餘燼宴會。\n\n雷納瑟王子或許是眾人矚目的主辦人，但我的目光更常放在你身上。\n\n你才是讓宴會順利進行的幕後功臣，就像我在女王的宴會上扮演的角色。\n\n<瓦許女爵一度陷入過去的回憶。>\n\n你的工作並不簡單。', 37474),
(202361, 'zhTW', '琪瑞安！歡迎來到永世文庫，透過靈魄的匯聚，我們得以強化你的能力。\n\n使用我的強化，你將會獲得：\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[晉升者之星]|h|r：在生命力高於90%時，你的傷害性法術和技能有一定機率對目標施放汲取印記，在一段時間內對他們造成傷害。在這段時間內擊敗敵人，就能收取他們的靈魄，並在短時間內為你施加護盾。', '琪瑞安！歡迎來到永世文庫，透過靈魄的匯聚，我們得以強化你的能力。\n\n使用我的強化，你將會獲得：\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[晉升者之星]|h|r：在生命力高於90%時，你的傷害性法術和技能有一定機率對目標施放汲取印記，在一段時間內對他們造成傷害。在這段時間內擊敗敵人，就能收取他們的靈魄，並在短時間內為你施加護盾。', 37474),
(199451, 'zhTW', '', '哈…我記得有一次在織夢者那邊…', 37474),
(183994, 'zhTW', '', '左邊一點！', 37474),
(183995, 'zhTW', '', '左邊！右邊！另一個右邊啦！', 37474),
(183993, 'zhTW', '你碰得到頂端嗎？', '', 37474),
(204708, 'zhTW', '死馬布蘭契順從地抬起足蹄，很高興有人幫她治療受傷的腳。她上氣不接下氣，噴著粗重的鼻息，看起來渴極了。', '', 37474),
(204686, 'zhTW', '你用刷子幫死馬布蘭契刷掉討厭的東西時，她輕輕顫動了一下，磨蹭著你。在她抬腳跺地的時候，你注意到她的足蹄有嚴重的損傷。', '', 37474),
(204663, 'zhTW', '死馬布蘭契很高興地吃起了燕麥。雖然她身上還有毛髮，但皮膚卻因為小蟲、荊棘，和惡臭的爛泥而搔癢不止。', '', 37474),
(204710, 'zhTW', '死馬布蘭契站得直挺挺的不動，讓人把鞍具毛毯披在她身上。布蘭契漸漸地停止發抖，開始在你的背包裡尋找點心。', '', 37474),
(204668, 'zhTW', '死馬布蘭契連忙停下腳步，這才沒有傷到你。', '', 37474),
(204903, 'zhTW', '死馬布蘭契的雙眼充滿瘋狂的氣息。她看起來病懨懨的，一副很憔悴的模樣。她顯然是餓壞了，需要好好飽餐一頓。', '', 37474),
(121956, 'zhTW', '我，馬迪亞斯‧肖爾，在此授權血刃海盜追殺叛逃特務，琥珀‧吉爾妮。', '', 37474),
(204709, 'zhTW', '死馬布蘭契激動地喝下整桶水，然後用她的頭撞撞你。她雖然解了渴，但卻不由自主地渾身顫抖。', '', 37474),
(54130, 'zhTW', '', '瑞爾…他傷得很重。$b$b<密探吉爾妮憤恨地揮拳搥打地面。>$b$b他快死了，$n！我們什麼都做不了！', 37474),
(204749, 'zhTW', '死馬布蘭契聞到蘋果香味時興奮地張大了鼻孔。她大口將蘋果全吃下了肚。死馬布蘭契滿足地嘆了一口氣，然後將她的頭靠在你的肩膀上。', '', 37474),
(121283, 'zhTW', '琥珀‧吉爾妮以前是自己人…真不敢相信我們殺了她。', '', 37474),
(197546, 'zhTW', '', '夠了！你們的舞姿和抽搐沒兩樣。', 37474),
(207303, 'zhTW', '幸好有你協助守護森林，獵手。', '幸好有你協助守護森林，獵手。', 37474),
(189107, 'zhTW', '雖然我們急需強大的施法者，但還是不能隨便降低入場條件。', '', 37474);
INSERT INTO `faction_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2463, 'zhTW', '瑪拉茲莫斯', '瑪拉茲莫斯是個難以置信，類似於蘑菇的生物。它居住在亞登曠野，整合了這個領域的生態系統。你想幫忙的心意讓它敞開了那像是心的部位，讓你有很多事情可以做。', 37474),
(2410, 'zhTW', '不死軍團', '統御者在很久以前創立了瑪卓薩斯五大家族，意圖打造終極戰鬥部隊。這支不屈不撓的大軍擁有力量、機智，以及謀略，他們立誓保衛暗影之境，抵抗所有威脅。', 37474),
(2465, 'zhTW', '曠野獵者', '曠野獵者中有來自亞登曠野各處的菁英獵手，他們在危急時刻會回應呼喚，效忠凜冬女王。在情況如此乾旱危急時，曠野獵者會做好準備，守護森林。', 37474),
(2462, 'zhTW', '縫合大師', '縫合大師以善於將血肉、白骨與靈魄結合為傀儡而知名，他們因此成為瑪卓薩司的強大盟友。縫合大師脫離狡詐的傀儡家族之後，就居住在屠夫區。', 37474),
(2464, 'zhTW', '暗夜之廷', '靈魄乾旱與佐斯特入侵佔據了凜冬女王與曠野獵者大部分的心力，留下暗夜之廷的樹林長保護野性種子，守護自己的林地。', 37474);
