INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1309, 'zhTW', '顫響的靈蜱', '|cFFFFD200冒險：|r暗影之境|n', '這些靈巧無比的飛行生物只要經過訓練，不再持續不斷吸取騎乘者身上的靈魄，就會是很好的坐騎。', 37474),
(1420, 'zhTW', '晦影鐮角蟲', '|cFFFFD200商人：|r軸鼻|n|cFFFFD200區域：|r亞登曠野|n', '晦影果姆是最容易馴服的果姆，不過牠們的角和上顎也是最大的。牠們非常溫馴，因為其他生物都會避免激怒牠們。', 37474),
(1414, 'zhTW', '罪奔者布蘭契', '|cFFFFD200NPC：|r死馬布蘭契|n|cFFFFD200地區：|r瑞文崔斯|n |n', '生前，布蘭契明明是一匹溫馴聽話的好馬，性情溫和又不挑食。她到底偷偷做了什麼壞事，才會淪落到這種下場，成為瑞文崔斯的罪魂？', 37474),
(1291, 'zhTW', '福雲', '|cFFFFD200遊戲內商城|r|n', '熊貓人相信光是用手摩擦公牛的閃亮毛皮就足以帶來好運，但難就難在你必須先抓住牠。', 37474),
(1424, 'zhTW', '雪暴熊', '|cFFFFD200暴雪30週年紀念|r ', '他源自冰雪，沐浴在艾澤拉斯的陽光下，與冒險者同行。', 37474);
INSERT INTO `lfg_dungeons_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2047, 'zhTW', '瑪卓薩斯 - 故事結局', '', 37474),
(2092, 'zhTW', '血濃於石', '戴納瑟斯的石源魔軍團將軍正在準備陷阱並等待目標出現，打算要把反叛軍一網打盡。', 37474),
(2090, 'zhTW', '吸血寶庫', '靈魄如同敞開的傷口從納撒亞城的寶庫湧洩而出。必須阻止靈魄繼續溢出，否則瑞文崔斯將會乾涸。', 37474),
(2096, 'zhTW', '覲見傲慢之王', '戴納瑟斯在他的高塔中渴望英雄們的到來，展開決定瑞文崔斯命運的最終決戰。', 37474),
(2091, 'zhTW', '豐裕聖物盒', '在貴族們陶醉在勝利中的同時，英雄們必須闖入他們的宴會並摧毀他們的權力基礎。', 37474),
(2070, 'zhTW', '死靈戰地', '', 37474),
(2074, 'zhTW', '贖罪之殿', '', 37474),
(2069, 'zhTW', '瘟疫之臨', '', 37474),
