(2089, 'zhTW', '晉升之路(教學)', '協助與你建立靈魂之絆的同伴，在晉升之路證明自我。', 37474),
(2084, 'zhTW', '晉升之路', '協助與你建立靈魂之絆的同伴，在晉升之路證明自我。', 37474),
