INSERT INTO `mail_template_locale` (`ID`, `locale`, `Body_lang`, `VerifiedBuild`) VALUES
(568, 'zhTW', '給$p，\n\n你在先前的信中提到你目前的擊殺數量，我不會質疑你在數字上的正確性。\n\n不過那數字實在高得可疑。但畢竟你是淵喉行者…\n\n儘管如此，我還是很享受我們之間的比賽，我會努力追上你。\n\n自從上次收到你的信以來，我的擊殺紀錄來到一百三十八次，然後…\n\n<狩獵隊長克芮恩的字跡戛然而止。>\n\n算成一百五十二次好了！儘管在最後一波當中夾雜了幾隻蜱蟲，不過你超前太多了，我不能太挑剔！\n\n超越我吧\n狩獵隊長克芮恩', 37474);
INSERT INTO `chr_classes_locale` (`ID`, `locale`, `Name_lang`, `NameMale_lang`, `NameFemale_lang`, `Description_lang`, `RoleInfoString_lang`, `DisabledString_lang`, `HyphenatedNameMale_lang`, `HyphenatedNameFemale_lang`, `VerifiedBuild`) VALUES
(3, 'zhTW', '獵人', '獵人', '獵人', '獵人往往以荒野為家，並且熱愛與野獸為伍。獵人需要仰賴所選擇的武器，以及寵物來造成傷害。', '角色類型：|cffffffff遠程或近戰傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '獵人', '獵人', 37474),
(1, 'zhTW', '戰士', '戰士', '戰士', '戰士是身著鎧甲的鬥士，致力於完美的武裝戰技。戰士會在戰鬥中產生怒氣，可用於施展特殊的攻擊招式。', '角色類型：|cffffffff坦克、近戰傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '戰士', '戰士', 37474),
(11, 'zhTW', '德魯伊', '德魯伊', '德魯伊', '德魯伊擅長變換自身的形態，並且與自然界有著緊密而特殊的聯繫。德魯伊可專精於治療，施放遠程法術，或是變身為採取近戰攻擊的獵豹或熊。', '角色類型：|cffffffff坦克、治療者、遠程傷害輸出、近戰傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '德魯伊', '德魯伊', 37474),
(5, 'zhTW', '牧師', '牧師', '牧師', '牧師是具備各式各樣能力的多元性治療者。話雖如此，牧師也可以犧牲治療能力，改用暗影魔法來造成傷害。', '角色類型：|cffffffff治療者、遠程傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '牧師', '牧師', 37474),
(8, 'zhTW', '法師', '法師', '法師', '法師是艾澤拉斯最具代表性的魔法使用者，他們的技藝來自於本身所熱衷的魔法探索與學習。法師只能穿著輕便的護甲，但擅於組合各式攻擊或防禦性質的強力法術來保護自己。', '角色類型：|cffffffff遠程傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '法師', '法師', 37474),
(7, 'zhTW', '薩滿', '薩滿', '薩滿', '薩滿使用元素的力量來強化他們的武器與法術。薩滿可以在戰鬥中召喚圖騰來牽制敵人、治療隊友，或者對敵人造成傷害。', '角色類型：|cffffffff治療者、遠程傷害輸出、近戰傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '薩滿', '薩滿', 37474),
(12, 'zhTW', '惡魔獵人', '惡魔獵人', '惡魔獵人', '惡魔獵人是所謂的英雄職業，新創角色的起使等級高於一般職業。惡魔獵人是黑暗的流放者，利用禁忌的惡魔之力獵殺敵人。', '角色類型：|cffffffff坦克、近戰傷害輸出|r', '需要《軍臨天下》和70級以上的角色。', '惡魔獵人', '惡魔獵人', 37474),
(9, 'zhTW', '術士', '術士', '術士', '術士使用火焰與暗影魔法來造成傷害、吸取能量，或者詛咒敵人。他們還會召喚惡魔僕從，供其使喚。', '角色類型：|cffffffff遠程傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '術士', '術士', 37474),
(4, 'zhTW', '盜賊', '盜賊', '盜賊', '盜賊通常都會擔任刺客或者斥候的角色，而許多盜賊也習慣獨來獨往。盜賊擅於透過潛行來接近敵人，或者從後方偷襲，然後快速地解決敵手。', '角色類型：|cffffffff近戰傷害輸出|r', '你必須選擇不同的種族才能玩這個職業。', '盜賊', '盜賊', 37474);
